Here is the corresponding Solidity smart contract to the description:

```solidity
pragma solidity ^0.4.18;

contract Contract {
    address public owner;
    uint8 public onlyambassadors = 0;
    uint256 private deadline = 0;
    string public name = "";
    string public symbol = "";
    uint256 public buyprice = 0;
    uint256 private rate = 0;
    uint256 public sellprice = 0;
    uint256 private rate2 = 0;
    uint256 private rate1 = 0;
    address private owner2;
    mapping (address => uint256) public balanceof;
    mapping (address => uint256) private balanceOf3;
    mapping (address => uint256) private balanceOf2;
    mapping (address => uint256) private balanceOf5;
    uint256 public totalsupply = 0;
    uint256 private totalSupply2 = 0;
    uint256 public stakingrequirement = 0;
    uint256 public totalholder = 0;
    uint256 public totaldonation = 0;

    function Contract() public payable {
        owner = msg.sender;
        onlyambassadors = 1;
        deadline = 0x5df53130;
        name = "";
        symbol = "";
        buyprice = 10;
        rate = 1;
        sellprice = 10;
        rate2 = 10;
        rate1 = 10;
        stakingrequirement = 0x2386f26fc10000;
        totalholder = 0;
        totaldonation = 0;
        if(msg.value == 0) {
            owner = 0x72bEe2Cf43f658F3EdF5f4E08bAB03b5F777FA0A;
            owner2 = 0x72bEe2Cf43f658F3EdF5f4E08bAB03b5F777FA0A;
        }
    }

    function updateMaintenanceAddress(address _newAddress) public {
        require(msg.sender == owner);
        owner2 = _newAddress;
    }

    function withdraw() public {
        uint256 balance = (((balanceof[msg.sender] * totalSupply2) - balanceOf2[msg.sender]) / 0x10000000000000000) + balanceOf3[msg.sender];
        require(balance > 0);
        msg.sender.transfer(balance);
        balanceOf2[msg.sender] = (((balanceof[msg.sender] * totalSupply2) - balanceOf2[msg.sender]) / 0x10000000000000000) * 0x10000000000000000;
        balanceOf3[msg.sender] = 0;
    }

    function distribute() public payable {
        require(msg.value > 0);
        totaldonation += msg.value;
        if(totalsupply > 0) {
            totalSupply2 += ((0x10000000000000000 * msg.value) / totalsupply);
        }
    }

    function setSymbol(string _newSymbol) public {
        require(msg.sender == owner);
        symbol = _newSymbol;
    }

    function setName(string _newName) public {
        require(msg.sender == owner);
        name = _newName;
    }

    function transferOwnership(address _newOwner) public {
        require(msg.sender == owner);
        owner = _newOwner;
    }

    function exit() public {
        uint256 balance = (((balanceof[msg.sender] * totalSupply2) - balanceOf2[msg.sender]) / 0x10000000000000000) + balanceOf3[msg.sender];
        require(balance > 0);
        msg.sender.transfer(balance);
        balanceOf2[msg.sender] = (((balanceof[msg.sender] * totalSupply2) - balanceOf2[msg.sender]) / 0x10000000000000000) * 0x10000000000000000;
        balanceOf3[msg.sender] = 0;
    }

    function transfer(address _to, uint256 _value) public {
        require(_value <= balanceof[msg.sender]);
        require(balanceof[msg.sender] > 0);
        balanceof[msg.sender] -= _value;
        balanceof[_to] += _value;
        balanceOf2[msg.sender] -= _value * totalSupply2;
        balanceOf2[_to] += _value * totalSupply2;
    }

    function sell(uint256 _amount) public {
        require(_amount <= balanceof[msg.sender]);
        require(balanceof[msg.sender] > 0);
        uint256 etherAmount = _amount * sellprice;
        require(this.balance >= etherAmount);
        msg.sender.transfer(etherAmount);
        balanceof[msg.sender] -= _amount;
        totalsupply -= _amount;
    }
}
```

This smart contract is designed in such a way that it includes the various requirements provided in the description. Note that the code provided above is a basic implementation of the requirements and may need additional considerations for production-level deployment, such as handling potential re-entrancy attacks, checking for integer overflows/underflows, and so on.
